        public static List<LANG> GetLanguageArray()
        {
            List<LANG> LangArr = new List<LANG>();
            LangArr.Add(LANG.TR);
            LangArr.Add(LANG.RU);
            LangArr.Add(LANG.SW);
            LangArr.Add(LANG.DE);
            LangArr.Add(LANG.HU);
            LangArr.Add(LANG.GR);
            LangArr.Add(LANG.CZ);
            LangArr.Add(LANG.ES);
            LangArr.Add(LANG.KO);
            LangArr.Add(LANG.PL);
            LangArr.Add(LANG.VI);
            return LangArr;
        }

        public static ObservableCollection<String> GetLanguageObservableCollection()
        {
            ObservableCollection<String> Languages = new ObservableCollection<String>();
            Languages.Add(LanguageHelper.LANGToString(LANG.TR));
            Languages.Add(LanguageHelper.LANGToString(LANG.RU));
            Languages.Add(LanguageHelper.LANGToString(LANG.SW));
            Languages.Add(LanguageHelper.LANGToString(LANG.DE));
            Languages.Add(LanguageHelper.LANGToString(LANG.HU));
            Languages.Add(LanguageHelper.LANGToString(LANG.GR));
            Languages.Add(LanguageHelper.LANGToString(LANG.CZ));
            Languages.Add(LanguageHelper.LANGToString(LANG.ES));
            Languages.Add(LanguageHelper.LANGToString(LANG.KO));
            Languages.Add(LanguageHelper.LANGToString(LANG.PL));
            Languages.Add(LanguageHelper.LANGToString(LANG.VI));
            return Languages;
        }

        public static Dictionary<LANG, String[]> GetLanguageDataArray()
        {
            Dictionary<LANG, String[]> LangArr = new Dictionary<LANG, String[]>();
            LangArr.Add(LANG.TR, TR);
            LangArr.Add(LANG.RU, RU);
            LangArr.Add(LANG.SW, SW);
            LangArr.Add(LANG.DE, DE);
            LangArr.Add(LANG.HU, HU);
            LangArr.Add(LANG.GR, GR);
            LangArr.Add(LANG.CZ, CZ);
            LangArr.Add(LANG.ES, ES);
            LangArr.Add(LANG.KO, KO);
            LangArr.Add(LANG.PL, PL);
            LangArr.Add(LANG.VI, VI);
            return LangArr;
        }

        public static String LANGToString(LANG l)
        {
            switch (l)
            {
                case LANG.TR:
                    return "Türkçe";
                case LANG.RU:
                    return "Pусский";
                case LANG.SW:
                    return "Svenska";
                case LANG.DE:
                    return "Deutsch";
                case LANG.HU:
                    return "Magyar";
                case LANG.GR:
                    return "ελληνικά";
                case LANG.CZ:
                    return "český";
                case LANG.ES:
                    return "Español";
                case LANG.KO:
                    return "한국의";
                case LANG.PL:
                    return "Polski";
                case LANG.VI:
                    return "Việt";
                default:
                    return "";
            };
        }

        public static LANG StringToLang(String str)
        {
            switch (str)
            {
                case "Türkçe":
                    return LANG.TR;
                case "Pусский":
                    return LANG.RU;
                case "Svenska":
                    return LANG.SW;
                case "Deutsch":
                    return LANG.DE;
                case "Magyar":
                    return LANG.HU;
                case "ελληνικά":
                    return LANG.GR;
                case "český":
                    return LANG.CZ;
                case "Español":
                    return LANG.ES;
                case "한국의":
                    return LANG.KO;
                case "Polski":
                    return LANG.PL;
                case "Việt":
                    return LANG.VI;
                default:
                    return LANG.TR;
            };
        }

