        public static void ApplySettings()
        {
            ResetDialer();
            IsolatedStorageSettings userSettings = IsolatedStorageSettings.ApplicationSettings;
            Int32 selectedLanguages = 0;
            if (userSettings.Contains("SelectedLanguages"))
            {
                selectedLanguages = Convert.ToInt32(userSettings["SelectedLanguages"]);
            }
            else
            {
                selectedLanguages = 0;
                userSettings["SelectedLanguages"] = 0;
                userSettings.Save();
            }

            Dictionary<LANG, String[]> langDict = GetLanguageDataArray();
            foreach (LANG l in GetLanguageArray())
            {
                if ((((int)l) & selectedLanguages) > 0)
                {
                    String[] arr = langDict[l];
                    for (int i = 0; i < 10; i++)
                    {
                        switch (i)
                        {
                            case 0:
                                Zero += arr[i];
                                break;
                            case 1:
                                One += arr[i];
                                break;
                            case 2:
                                Two += arr[i];
                                break;
                            case 3:
                                Three += arr[i];
                                break;
                            case 4:
                                Four += arr[i];
                                break;
                            case 5:
                                Five += arr[i];
                                break;
                            case 6:
                                Six += arr[i];
                                break;
                            case 7:
                                Seven += arr[i];
                                break;
                            case 8:
                                Eight += arr[i];
                                break;
                            case 9:
                                Nine += arr[i];
                                break;
                        }
                    }
                }
            }

            FinishDialer();
        }

