        public static String ButtonToGlobPiece(char c)
        {
            switch (c)
            {
                case '0':
                    return Zero;
                case '1':
                    return One;
                case '2':
                    return Two;
                case '3':
                    return Three;
                case '4':
                    return Four;
                case '5':
                    return Five;
                case '6':
                    return Six;
                case '7':
                    return Seven;
                case '8':
                    return Eight;
                case '9':
                    return Nine;
                case '*':
                    return "?";
                default:
                    return c.ToString();
            }
        }
